/**
 * Defines a single waypoint
 * @param {string} selector (the selector triggering the waypoint)
 * @param {string} target (the target for the animation)
 * @param {obj} config (an obj containing config for our functions)
 */
const setWP = (selector,target,type,direction,rotation,duration,delay,easing,logging) => {
    $(selector).waypoint({
        handler: function(){
            animate(target,type,direction,rotation,duration,delay,easing,logging)
        },
        offset: 'bottom-in-view',
        triggerOnce: true
    })
}

/**
 * Defines a multi waypoint for more than one target with the same selector
 * @param {string} selector (the selector triggering the waypoint)
 * @param {array} targets (the target selectors for the animation)
 * @param {obj} animationFuncConfig (an obj containing config for our functions)
 */
const setMultiWP = (selector,targets,type,direction,rotation,duration,delay,easing,logging) => {
    $(selector).waypoint({
        handler: function(direction){
            for(let x=0; x<= targets.length; x++) {
                animate(targets[x],type,direction,rotation,duration,delay,easing,logging)
            }
        },
        offset: 'bottom-in-view',
        triggerOnce: true
    })
}

/**
 * Animates element with slide or pop
 * @param {string} target 
 * @param {string} type (slide, pop)
 * @param {string} direction 
 * @param {string} rotation 
 * @param {int} duration 
 * @param {int} delay 
 * @param {string} easing 
 */
const animate = (target,type,direction,rotation,duration,delay,easing,logging) => {
    let animsConfig = {};

    switch(type) {
        case "slide":
            animsConfig.opacity = 0,
            animsConfig.rotation = rotation ? rotation : 0
            animsConfig.duration = duration ? duration : 1
            animsConfig.delay = delay ? delay : 0
        
            switch (direction) {
                case "up":
                    animsConfig.y = 999;
                    break;
                case "down":
                    animsConfig.y = -999;
                    break;
                case "left":
                    animsConfig.x = -999;
                    break;
                case "right":
                    animsConfig.x = 999;
                    break;
            
                default:
                    animsConfig.y = -999;
                    break;
            }
            break;

        case "pop":
            animsConfig.opacity = 0
            animsConfig.scale = 0
            animsConfig.rotation = rotation ? rotation : 0
            animsConfig.duration = duration ? duration : 1
            animsConfig.delay = delay ? delay : 0
            break;

        default:
            animsConfig.opacity = 0
            animsConfig.scale = 0
            animsConfig.rotation = rotation ? rotation : 0
            animsConfig.duration = duration ? duration : 1
            animsConfig.delay = delay ? delay : 0
            break;
    }

    logging ? console.log(animsConfig) : null
    easing ? animsConfig.ease = easing : null
    gsap.from(target, animsConfig)
}